import React from 'react';
import CloseIcon from '@mui/icons-material/Close';
import img from "../profile.webp";
import { Avatar } from '@mui/material';
import InfoIcon from '@mui/icons-material/Info';
import NotificationsNoneOutlinedIcon from '@mui/icons-material/NotificationsNoneOutlined';
import { InfoOutlined } from '@mui/icons-material';

const User = ({username}) => {
  return (
    <div className='' style={{backgroundColor:'#373A41',color:'white'}}>
        <div className='flex px-3 py-4' style={{borderBottom:'1px solid red'}}>
            <div className='flex-1'>User Info</div>
            <CloseIcon/>
        </div>

        <div style={{borderBottom:'1px solid red'}}>
            <Avatar alt="Profile-Picture" src={img} />
            {username}
        </div>

        <div style={{borderBottom:'1px solid red'}}>
                <div className='flex'>
                        <InfoOutlined/>
                </div>
        </div>


    </div>
  )
}

export default User
